{% extends 'base.html.twig' %}

{% block title %}Modifier un livraison{% endblock %}
{% block body %}
<div class=\"container mt-4\">
    <h2>Modifier le livraison</h2>

    {{ form_start(form) }}

        <div class=\"form-group\">
            {{ form_label(form.adresse, 'Adresse du livraison') }}
            {{ form_widget(form.adresse, {'attr': {'class': 'form-control'}}) }}
            {{ form_errors(form.adresse) }}
        </div>

        <div class=\"form-group\">
            {{ form_label(form.etat, 'État du livraison') }}
            {{ form_widget(form.etat, {'attr': {'class': 'form-control'}}) }}
            {{ form_errors(form.etat) }}
        </div>

        <div class=\"form-group\">
            {{ form_label(form.created, 'Date de création') }}
            {{ form_widget(form.created, {'attr': {'class': 'form-control'}}) }}
            {{ form_errors(form.created) }}
        </div>

        <div class=\"form-group\">
            {{ form_label(form.commande, 'Article lié') }}
            {{ form_widget(form.commande, {'attr': {'class': 'form-control'}}) }}
            {{ form_errors(form.commande) }}
        </div>

        <button type=\"submit\" class=\"btn btn-primary mt-3\">Mettre à jour</button>

    {{ form_end(form) }}
</div>
{% endblock %}
